var WebSocket = require('ws');

var ws, symbols, contract_id = 1,
    m = 0,
    i = -1,
    ref = 0,
    spots = new Array;
class App {
    constructor(t) {
        this.tokens = t,
        this.url    = 'wss://ws.binaryws.com/websockets/v3?app_id=23499';
    }
    send(t) {
        ws.send(JSON.stringify(t))
    }
    spot(t) {
        symbols = t, this.send({
            ticks_history: t,
            adjust_start_time: 1,
            count: 32,
            end: "latest",
            start: 1,
            style: "ticks"
        })
    }
    portfolio() {
        this.send({
            proposal_open_contract: 1,
            contract_id: contract_id,
            subscribe: 1
        })
    }
    stop() {
        ws.close()
    }
    buy(t) {
        var s = {
            parameters: {
                amount: Number(t.stake).toFixed(2),
                basis: "stake",
                contract_type: "RISE" == t.contract ? "CALL" : "PUT",
                duration: t.duration,
                currency: t.currency,
                duration_unit: t.duration_set,
                symbol: symbols
            },
            buy: 1,
            price: Number(t.stake).toFixed(2)
        };
        this.send(s)
    }
}

